import React from "react";

export default function Button() {
    return (
        <>
            <input type="submit" value="Submit" className="btn btn-lg buttonPrimary" />

            <style>
                {
                    `
                        .buttonPrimary {
                            background-color: white;
                            color: #1B48E9;
                            font-weight: 600;
                        }
                    `
                }
            </style>
        </>

    )
}
